import React from 'react';

const Navigation = () => {
  return (
    <nav className="navbar">
      <ul>
        <li>
          <a href="#search-section">Search</a>
        </li>
        <li>
          <a href="#image-section">Images</a>
        </li>
        <li>
          <a href="#about-section">About</a>
        </li>
      </ul>
    </nav>
  );
};

export default Navigation;
